                                        <FontAwesomeIcon icon={faProductHunt} className="mr-auto" style={styles.product_fontawesome} />
                                        <CountUp start={0} end={this.state.noOfTtotalProducts} delay={0} duration={10}>
                                            {({ countUpRef }) => (
                                                <div>
                                                <span className="number_count" ref={countUpRef} />
                                                </div>
                                            )}
                                        </CountUp>
                                    </Row>
                                </Card.Text>
                                <Card.Text style={styles.card_text}>
                                    <p>
                                        <span className="label_span">Total Products</span>
                                    </p>
                                    <Row noGutters style={styles.card_text_row_total_product}>
                                        <FontAwesomeIcon icon={faProductHunt} className="mr-auto" style={styles.product_fontawesome} />
                                        <CountUp start={0} end={this.state.noOfTtotalProducts} delay={0} duration={10}>
                                            {({ countUpRef }) => (
                                                <div>
                                                <span className="number_count" ref={countUpRef} />
                                                </div>
                                            )}
                                        </CountUp>
                                    </Row>
                                </Card.Text>
                                <Card.Text style={styles.card_text}>
                                    <p>
                                        <span className="label_span">Total Products</span>
                                    </p>
                                    <Row noGutters style={styles.card_text_row_total_product}>
                                        <FontAwesomeIcon icon={faProductHunt} className="mr-auto" style={styles.product_fontawesome} />
                                        <CountUp start={0} end={this.state.noOfTtotalProducts} delay={0} duration={10}>
